INSERT INTO `tbl_team` (`RecordNo`, `PageName`, `PageTitle`, `datevalue`, `Location`, `Description`, `qualification`, `post`, `representative`, `Type`, `MetaKeyword`, `MetaDescription`, `Serial`, `CoverImage`, `DocPath`, `Disabled`, `created`, `lastmodified`, `created_by`, `PageTitleNepali`, `qualificationNepali`, `postNepali`, `representativeNepali`, `DescriptionNepali`) VALUES
(1, 'sunil-pant1', 'Sunil Pant', NULL, NULL, '', '', '                 Chief Executive Officer', NULL, 'g', '', '', 0, '1657611747Sunil_Sir_Edited_New.jpg', NULL, 0, '2018-10-29 08:03:53', '2022-07-12 07:42:27', 18, 'श्री सुनील पंत', 'एमबीए', 'प्रमुख कार्यकारी अधिकृत', NULL, '<p>श्री पंत त्रिभुवन विश्वविद्यालयबाट एमबीए स्नातक हुनुहुन्छ र उनीसँग २५&nbsp;&nbsp;वर्ष भन्दा बढीको बैंकिंग अनुभव नेपालका प्रमुख वित्तीय संस्था र वाणिज्य बैंकहरूसँग छ। उहाँ एक अनुभवी पेशेवर हुनुहुन्छ जसले समग्र वित्तीय संस्थाको व्यवस्थापनमा राम्रो पकड राख्नुहुन्छ।</p>\r\n'),
(2, 'amit-shrestha2', 'Amit Shrestha', NULL, NULL, '', '', 'Deputy Chief Executive Officer', NULL, 'g', '', '', 0, '16557853212.jpg', NULL, 0, '2018-12-13 10:30:50', '2022-06-21 06:06:47', 18, 'श्री अमित श्रेष्ठ', '', '', NULL, '<p>श्री श्रेष्ठ काठमाडौं विश्वविद्यालयबाट एमबीए स्नातक हुन् र उनीसँग १६&nbsp;वर्ष भन्दा बढीको बैंकिंग अनुभव छ जसमा &nbsp;६&nbsp;बर्ष नेपाल एसबीआई नेपाल लिमिटेडसँग छ र उनिलाई क्रेडिट व्यवस्थापन र शाखा संचालनको राम्रो ज्ञान छ।</p>\r\n'),
(3, 'lachhaman-prasad-jaisi3', 'Lachhaman Prasad Jaisi', NULL, NULL, '', '', 'Deputy General Manager', NULL, 'g', '', '', 0, '1657611940lachaman_sir.jpg', NULL, 0, '2018-12-13 10:31:14', '2022-07-12 07:45:40', 18, 'श्री  लक्ष्मण प्रसाद जैसी', '', 'प्रमुख वित्तीय अधिकारी', NULL, '<p>श्री जयसी बी.क. (ऑनर्स) र एल.एल.बी. ले ​​भारतको उडिस्साको सम्बलपुर विश्वविद्यालयबाट स्नातक छन् र चौध वर्ष भन्दा बढीको बैंकिंग अनुभव छ जसमा सिद्धार्थ बैंक लिमिटेडसँग <strong>&nbsp;६&nbsp;</strong>&nbsp;बर्ष वित्त र योजनाको प्रमुखको रूपमा रहेको छ र यस क्षेत्रमा राम्रो ज्ञान छ। वित्त, कोषागार, जोखिम व्यवस्थापन र क्रेडिट व्यवस्थापन।</p>\r\n'),
(4, 'sanjaya-thapaliya4', 'Sanjaya Thapaliya  ', NULL, NULL, '', '', 'Senior Manager', NULL, 'g', '', '', 0, '16557852833.jpg', NULL, 0, '2021-12-21 02:45:19', '2022-06-21 06:06:16', 18, 'Sanjaya Thapaliya  ', '', 'Senior Manager', NULL, '');
